import React, { useState } from "react";
import "./App.css";

function Collapsible() {
  const [IsOpen, setIsOpen] = useState(false);
  return (
    <div className="Collapsible">
      <div className="button" onClick={() => setIsOpen(!IsOpen)}>
        About Us
      </div>
      {IsOpen && (
        <div className="paragraph" onClick={() => setIsOpen(!IsOpen)}>
          How does parkname seperate itself from other domain name parking
          companies?
        </div>
      )}
      {IsOpen && (
        <div className="paragraph" onClick={() => setIsOpen(!IsOpen)}>
          How does parkname seperate itself from other domain name parking
          companies?
        </div>
      )}
